import React from "react";
import {
  Navbar,
  Nav,
  Button,
  OverlayTrigger,
  Popover,
  NavDropdown,
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css"; // Import Bootstrap CSS

const CustomNavbar = () => {

  const popoverHoverFocus = (
    <Popover id="popover-trigger-hover-focus" title="Popover bottom">
      <strong>Holy guacamole!</strong> Check this info.
    </Popover>
  );

  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand>
        <span className="font-weight-bold">EsaLink</span>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="https://www.google.com">Tma connection</Nav.Link>
        </Nav>
        <Button variant="primary">Get a Demo</Button>
        {/* <OverlayTrigger
          trigger={["hover", "focus"]} // Include 'focus' trigger
          placement="bottom"
          overlay={expertisePopover}
        >
          <Nav.Link>Expertise</Nav.Link>
        </OverlayTrigger> */}

<OverlayTrigger
      trigger={['hover', 'focus']}
      placement="bottom"
      overlay={popoverHoverFocus}
    >
      <Button>Hover + Focus</Button>
    </OverlayTrigger>


{/* <button type="button" className="btn btn-lg btn-danger" data-toggle="popover" title="Popover title" data-content="And here's some amazing content. It's very engaging. Right?">Click to toggle popover</button> */}

        {/* <OverlayTrigger
          trigger={["hover", "focus"]} // Include 'focus' trigger
          placement="bottom"
          overlay={solutionsPopover}
        >
          <Nav.Link>Solutions</Nav.Link>
        </OverlayTrigger> */}

        <Nav.Item className="ml-auto">
          <NavDropdown title="Dropdown" id="nav-dropdown">
            {/* Add dropdown items here */}
            <NavDropdown.Item>Action</NavDropdown.Item>
            <NavDropdown.Item>Another action</NavDropdown.Item>
          </NavDropdown>
        </Nav.Item>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default CustomNavbar;
